import React from 'react';
import styled from 'styled-components';
import PropTypes from 'prop-types';
import './App.css';
import memoji from './img/memoji.png';

const svg = (
  <svg width="251" height="251" className="name-svg">
    <defs>
      <pattern id="image" patternUnits="userSpaceOnUse" height="200" width="200">
        <image x="45" y="40" height="150" width="150" xlinkHref={memoji} />
      </pattern>
      <path
        id="curve"
        d="
M 120 120
m -80, 0
a 80,80 0 1,1 160,0
a 80,80 0 1,1 -160,0
"
      />
    </defs>
    <text className="header-name" fill="black">
      <textPath
        xlinkHref="#curve"
      >
        Jade Fung
      </textPath>
      <animateTransform
        attributeType="xml"
        attributeName="transform"
        type="rotate"
        from="0,120,120"
        to="360,120,120"
        begin="0"
        dur="60s"
        repeatCount="indefinite"
      />
    </text>
    <circle id="pic" className="header-circle" cx="120" cy="90" r="110" fill="url(#image)" />
  </svg>
);

const App = ({ className }) => (
  <div className={className}>
    <div className="container-fluid">
      <div className="row fullheight">
        <div className="col d-flex flex-column justify-content-center align-items-center">
          <span style={{}}>jade fung</span>
        </div>
        <div className="col d-flex flex-column justify-content-center align-items-center wordmark-container">
          {svg}
        </div>
      </div>
    </div>
  </div>
);

App.propTypes = {
  className: PropTypes.string.isRequired,
};

export default styled(App)`
  @import url('https://fonts.googleapis.com/css2?family=Work+Sans:ital,wght@0,300;0,900;1,300;1,900&display=swap');
  font-family: 'Work Sans', sans-serif;
  font-weight: 900;

  .wordmark-container {
    background-image:url("data:image/svg+xml;utf8,<svg xmlns='http://www.w3.org/2000/svg' version='1.1' height='50px' width='120px'><text x='0' y='15' fill='black' font-size='52' font-family='Work Sans, sans-serif'>Jade Fung</text></svg>");
  }

  .fullheight {
    height: 100vh;
  }
  .name-svg {
    width: 251px;
    height: 251px;
  }
  .header-name {
    font-size: 52pt;
  }
`;
